import React from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
// import 'react-tabs/style/react-tabs.css';


const FlashcardTabs = () => (
    <Tabs>
      <TabList className="TabList">
        <Tab className="Tab">Your sets</Tab>
        <Tab className="Tab">Group Sets</Tab>
        <Tab className="Tab">Public Sets</Tab>
      </TabList>

      <TabPanel>
        <h2>List of user's sets + link to new set form</h2>
      </TabPanel>
      <TabPanel>
        <h2>List of sets from groups user is in </h2>
      </TabPanel>
      <TabPanel>
        <h2>First 10 public sets</h2>
      </TabPanel>
    </Tabs>
  );

  export default FlashcardTabs
